import React from "react";

import './Header.css'

export default () => {
    return (
        <header>
            <div className="header--logo">
                <a href="/">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" alt="Netflix" />
                </a>
            </div>
        </header>
    )
}
